import React from "react";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import { useContext} from "react";
import { Appcontext } from "../App";
import ReadbyDoctorId from "./Questions/Answers/MydoctorAnsws";
import ReadbyPatientId from "./Questions/MypatientQns";


function MyStackExchange() {

  const { userType } = useContext(Appcontext);

  
  return (
    <>
      {[false].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
          <Container fluid>
            <Navbar.Brand href="#">Navbar Offcanvas</Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />

          </Container>
        </Navbar>
      ))}

      {userType === "doctor"?<ReadbyDoctorId/> : <ReadbyPatientId/>}
    </>
  );
}

export default MyStackExchange;
